  render() {
  return (
   <div className="App">     
   <Route path="/login" component={login}/> 
   <div class="nav">
    <button class="boutonco"  onClick={this.click}><span>Se connecter</span>
    </button>
  </div>  
    </div>
  );
}
click(){this.props.history.push("/login")}
